import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import AdminLogin from './pages/Admin/AdminLogin';
import AdminLayout from './admin/layout/AdminLayout';
import AdminDashboard from './admin/pages/Dashboard/AdminDashboard';
import './App.css';

// Simple components for main site
const Home = () => <div style={{ padding: '20px' }}><h1>Home Page</h1></div>;
const Men = () => <div style={{ padding: '20px' }}><h1>Men's Collection</h1></div>;
const Women = () => <div style={{ padding: '20px' }}><h1>Women's Collection</h1></div>;
const Kids = () => <div style={{ padding: '20px' }}><h1>Kids Collection</h1></div>;

// Simple admin products page for demo
const AdminProducts = () => (
  <div>
    <h2>Product Management</h2>
    <p>Manage your products here.</p>
  </div>
);

function App() {
  return (
    <Router>
      <div className="App">
        {/* Main site routes */}
        <Routes>
          <Route path="/admin/*" element={
            <Routes>
              <Route path="login" element={<AdminLogin />} />
              <Route path="*" element={<AdminLayout />}>
                <Route index element={<AdminDashboard />} />
                <Route path="products" element={<AdminProducts />} />
                <Route path="orders" element={<div><h2>Orders</h2></div>} />
                <Route path="users" element={<div><h2>Users</h2></div>} />
              </Route>
            </Routes>
          } />
          
          {/* Public routes with navbar */}
          <Route path="*" element={
            <>
              <Navbar />
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/men" element={<Men />} />
                <Route path="/women" element={<Women />} />
                <Route path="/kids" element={<Kids />} />
                <Route path="*" element={<Navigate to="/" replace />} />
              </Routes>
            </>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
